  padding: 12px 14px;
  font-size: 24px;
  border-radius: 10px;
  margin: 4px 26px;

  text-align: center;
  &:hover {
    background-color: white;
    color: hotpink;
  }
`;

const rankingStyle = css`
  width: 9px;
  height: 23px;
  left: 40px;
  top: 435px;

  font-family: Noto Sans;
  font-style: normal;
  font-weight: normal;
  font-size: 14px;
  line-height: 161.7%;

  color: #202020;
`;

const profileImageStyle = css`
  width: 24px;
  height: 24px;
  border-radius: 50%;
  background-color: #f3f3f3;
`;
const nicknameStyle = css`
  font-family: Pretendard;
  font-style: normal;
  font-weight: 600;
  font-size: 16px;
  line-height: 161.7%;
  // identical to box height, or 26px

  color: #202020;
`;

const TopUserRow = () => {};
const UserRow = () => {
  return (
    <div css={divStyle}>
      <div css={rankingStyle}>1</div>
      <div css={profileImageStyle}></div>
      <div css={nicknameStyle}>Jason</div>
      <div className="user-row__score">99</div>
    </div>
  );
};

export { UserRow, TopUserRow };
